class JnxoptIfBitRateK(TextualConvention, Integer32):
    description = 'Indicates the index that is used to represent a supported bit rate and the different versions of OPUk, ODUk and OTUk. Allowed values of k are defined in ITU-T G.709. Currently allowed values in G.709 are: k=1 represents an approximate bit rate of 2.5 Gbit/s, k=2 represents an approximate bit rate of 10 Gbit/s, k=3 represents an approximate bit rate of 40 Gbit/s.'
    status = 'current'

class JnxoptIfDEGM(TextualConvention, Unsigned32):
    description = 'Indicates the threshold level for declaring a Degraded Signal defect (dDEG). A dDEG shall be declared if JnxoptIfDEGM consecutive bad PM Seconds are detected.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(2, 10)

class JnxoptIfDEGThr(TextualConvention, Unsigned32):
    description = 'Indicates the threshold level for declaring a performance monitoring (PM) Second to be bad. A PM Second is declared bad if the percentage of detected errored blocks in that second is greater than or equal to JnxoptIfDEGThr.'
    status = 'current'
    subtypeSpec = Unsigned32.subtypeSpec + ValueRangeConstraint(1, 100)

